"use strict";
class HostCapabilities {
    get capabilities() {
        return {
            "win32": {
                debugToolsSupported: true
            },
            "darwin": {
                debugToolsSupported: true
            },
            "linux": {
                debugToolsSupported: false
            }
        };
    }
}
exports.HostCapabilities = HostCapabilities;
$injector.register("hostCapabilities", HostCapabilities);
